import React from "react";
import {Button,Form} from "react-bootstrap";
import {Link} from "react-router-dom";

function Interest({onSubmit,onChange}){
    return(
        <Form onSubmit={onSubmit}>
            <h5>Choose According to your interest</h5>
            <Form.Group controlId="action">
            <Form.Check type="checkbox" id="action" name="action" value="action" />
            <Form.Label for="action"> Action</Form.Label>
            </Form.Group>
            <Form.Group controlId="comedies">
            <Form.Check type="checkbox" label="Comedies" name="comedies" value="comedies" />
            </Form.Group>
        </Form>
    )
}
export default  Interest;
